printf("%s", i < file_diff->hunk_nr ?
       _("go to which hunk (<ret> to see "
	 "more)? ") : _("go to which hunk? "));

return error((side == DIFF_NEW_NAME) ?
    _("git apply: bad git-diff - inconsistent new filename on line %d") :
    _("git apply: bad git-diff - inconsistent old filename on line %d"), state->linenr);

return error(_("missing binary patch data for '%s'"),
	     patch->new_name ?
	     patch->new_name :
	     patch->old_name);

res = xcalloc(1, st_add3(sizeof(*res),
			 st_mult(sizeof(struct attr_state), num_attr),
			 is_macro ? 0 : namelen + 1));

item->util = xstrdup((flags & REF_ISBROKEN) ? "broken"
		    : (flags & REF_ISSYMREF) ? target
		    : repo_find_unique_abbrev(the_repository, &oid, DEFAULT_ABBREV));

return quiet_on_missing ? -1 :
	error(_("commit %s exists in commit-graph but not in the object database"),
	      oid_to_hex(&item->object.oid));

return quiet_on_missing ? -1 :
	error("Could not read %s",
	     oid_to_hex(&item->object.oid));

size_t min_len = ee1->patternlen <= ee2->patternlen
		 ? ee1->patternlen
		 : ee2->patternlen;

enum object_type type = oe ? oe->type :
			oid_object_info(the_repository, &oid,
					NULL);

const char *dangling_msg = dry_run
	? _("   (%s will become dangling)")
	: _("   (%s has become dangling)");

return hold_lock_file_for_update_timeout(
		lk, path, LOCK_NO_DEREF,
		get_files_ref_lock_timeout_ms()) < 0 ? -1 : 0;

die((flags & HASH_WRITE_OBJECT)
    ? "Unable to add %s to database"
    : "Unable to hash %s", path);

const char *msg = have_message ?
	"Fast-forward (no commit created; -m option ignored)" :
	"Fast-forward";

return S_ISDIR(mode) ? OBJ_TREE :
	S_ISGITLINK(mode) ? OBJ_COMMIT :
	OBJ_BLOB;

return (st == Z_STREAM_END &&
	stream.total_out == expect &&
	stream.total_in == len) ? 0 : -1;

size_t clear_len = counters_sb->len < last_count_len ?
		last_count_len - counters_sb->len + 1 :
		0;

current_branch ? _("There is no tracking information for "
	"the current branch.") :
	_("You are not currently on a branch."));

return s && s->sort_flags & REF_SORTING_ICASE ?
	strcasecmp(a->refname, b->refname) :
	strcmp(a->refname, b->refname);

const char *dangling_msg = dry_run
	? _(" %s will become dangling!")
	: _(" %s has become dangling!");

die(symmetric
    ? "Invalid symmetric difference expression %s"
    : "Invalid revision range %s", arg);

attempt_apply ?
_("Applying autostash resulted in conflicts.") :
_("Autostash exists; creating a new stash entry."));

const char *oid = flags & TODO_LIST_SHORTEN_IDS ?
		  short_commit_name(r, item->commit) :
		  oid_to_hex(&item->commit->object.oid);

humanise_rate == 0 ?
	/* TRANSLATORS: IEC 80000-13:2008 gibibyte */
	_("%u.%2.2u GiB") :
	/* TRANSLATORS: IEC 80000-13:2008 gibibyte/second */
	_("%u.%2.2u GiB/s"),

humanise_rate == 0 ?
	/* TRANSLATORS: IEC 80000-13:2008 mebibyte */
	_("%u.%2.2u MiB") :
	/* TRANSLATORS: IEC 80000-13:2008 mebibyte/second */
	_("%u.%2.2u MiB/s"),

humanise_rate == 0 ?
	/* TRANSLATORS: IEC 80000-13:2008 kibibyte */
	_("%u.%2.2u KiB") :
	/* TRANSLATORS: IEC 80000-13:2008 kibibyte/second */
	_("%u.%2.2u KiB/s"),

humanise_rate == 0 ?
	/* TRANSLATORS: IEC 80000-13:2008 byte */
	Q_("%u byte", "%u bytes", bytes) :
	/* TRANSLATORS: IEC 80000-13:2008 byte/second */
	Q_("%u byte/s", "%u bytes/s", bytes),

TEST(TEST_INPUT(((int []){ 2, 6, 3, 10, 9, 5, 7, 4, 5, 8, 1, DUMP }),
		((int []){ 1, 2, 3, 4, 5, 5, 6, 7, 8, 9, 10 })),
     "prio-queue works for basic input");

TEST(TEST_INPUT(((int []){ 6, 2, 4, GET, 5, 3, GET, GET, 1, DUMP }),
		((int []){ 2, 3, 4, 1, 5, 6 })),
     "prio-queue works for mixed put & get commands");

TEST(TEST_INPUT(((int []){ 1, 2, GET, GET, GET, 1, 2, GET, GET, GET }),
		((int []){ 1, 2, MISSING, 1, 2, MISSING })),
     "prio-queue works when queue is empty");

TEST(TEST_INPUT(((int []){ STACK, 8, 1, 5, 4, 6, 2, 3, DUMP }),
		((int []){ 3, 2, 6, 4, 5, 1, 8 })),
     "prio-queue works when used as a LIFO stack");

TEST(TEST_INPUT(((int []){ STACK, 1, 2, 3, 4, 5, 6, REVERSE, DUMP }),
		((int []){ 1, 2, 3, 4, 5, 6 })),
     "prio-queue works when LIFO stack is reversed");

return error("%s: unable to read file.",
		name_to_report ?
		name_to_report :
		repo_find_unique_abbrev(the_repository, oid, DEFAULT_ABBREV));

return within_depth(base->buf, baselen,
		    !!S_ISDIR(entry->mode),
		    ps->max_depth) ?
	entry_interesting : entry_not_interesting;

return quiet_on_missing ? -1 :
	error("Could not read %s",
	     oid_to_hex(&item->object.oid));

stream.avail_out = bufsize > size - stream.total_out ?
			   size - stream.total_out :
			   bufsize;

return o->quiet ? -1 :
	error(ERRORMSG(o, ERROR_BIND_OVERLAP),
	      super_prefixed(a->name, o->super_prefix),
	      super_prefixed(old->name, o->super_prefix));

error(ERRORMSG(o, ERROR_BIND_OVERLAP),
      super_prefixed(a->name, o->super_prefix),
      super_prefixed(old->name, o->super_prefix));
